import React from "react";

const TableHeader = () => {
  return (
    <thead>
      <tr>
        <th>Name</th>
        <th>Total</th>
      </tr>
    </thead>
  );
};
function TestClick(id) {
  console.log(id);
}

const TableBody = (props) => {
  const rows = props.itemData.map((row, index) => {
    return (
      <tr key={index}>
        <td>{index}</td>
        <td>{row.name}</td>
        <td>{row.age}</td>
        <td>
          <button onClick={() => props.removeItem(index)}>Delete</button>
          <button onClick={TestClick(index)}>test</button>
        </td>
      </tr>
    );
  });
  return <tbody>{rows}</tbody>;
};

const Table = (props) => {
  const { itemData, removeItem } = props;

  return (
    <table>
      <TableHeader />
      <TableBody itemData={itemData} removeItem={removeItem} />
    </table>
  );
};

export default Table;
